import React from "react";
import './Quiz.css';
const Score = ({ score, onReset }) => {
  return (
    <div className="score-section">
      <div className="score-text">You scored {score} out of 10</div>
      <button onClick={onReset}>Reset Quiz</button>
    </div>
  );
};

export default Score;
